import React, { useState } from "react";

const data = { id: 1, example: 'test', answer: 'тест' }

export default function WriteRightText() {
    const [value, setValue] = useState('')

    return (
        <div className="WriteRightText">
            <div className="WriteRightText__example">
                <p>{data.example}</p>
            </div>
            <input value={value} type="text" onChange={() => setValue(e.target.value)} />
        </div>
    )
}
